prompt PL/SQL Developer import file
prompt Created on יום שלישי 23 יולי 2024 by Tehila Benezra
set feedback off
set define off
prompt Creating BRANCH...
create table BRANCH
(
  branchid      NUMBER(5) not null,
  branchaddress VARCHAR2(30) not null,
  branchmanager VARCHAR2(30) not null
)
;
alter table BRANCH
  add primary key (BRANCHID);

prompt Creating ACOUNT...
create table ACOUNT
(
  accountid     NUMBER(5) not null,
  balance       INTEGER default 0 not null,
  accountnumber INTEGER not null,
  branchid      NUMBER(5) not null
)
;
alter table ACOUNT
  add primary key (ACCOUNTID);
alter table ACOUNT
  add foreign key (BRANCHID)
  references BRANCH (BRANCHID);

prompt Creating ACTIONS...
create table ACTIONS
(
  actionid   NUMBER(5) not null,
  actionname VARCHAR2(30) not null,
  actionsum  INTEGER not null,
  actiondate DATE default SYSDATE not null
)
;
alter table ACTIONS
  add primary key (ACTIONID);

prompt Creating CLIENT...
create table CLIENT
(
  clientid       NUMBER(5) not null,
  clientname     VARCHAR2(30) not null,
  clientaddress  VARCHAR2(30) not null,
  clientlastname VARCHAR2(30) not null
)
;
alter table CLIENT
  add primary key (CLIENTID);
alter table CLIENT
  add constraint CHK_CLIENT_NAME
  check (LENGTH(ClientName) > 1);

prompt Creating ACTIVITY...
create table ACTIVITY
(
  activityid NUMBER(5) not null,
  clientid   NUMBER(5) not null,
  actionid   NUMBER(5) not null,
  accountid  NUMBER(5) not null,
  workerid   INTEGER not null
)
;
alter table ACTIVITY
  add primary key (ACTIVITYID);
alter table ACTIVITY
  add foreign key (CLIENTID)
  references CLIENT (CLIENTID);
alter table ACTIVITY
  add foreign key (ACTIONID)
  references ACTIONS (ACTIONID);
alter table ACTIVITY
  add foreign key (ACCOUNTID)
  references ACOUNT (ACCOUNTID);

prompt Creating CATEGORYS...
create table CATEGORYS
(
  category_id   NUMBER(3) not null,
  category_name VARCHAR2(15) not null
)
;
alter table CATEGORYS
  add primary key (CATEGORY_ID);

prompt Creating CLIENT_S...
create table CLIENT_S
(
  client_id      NUMBER(3) not null,
  client_name    VARCHAR2(15) not null,
  is_club_member NUMBER(1) not null
)
;
alter table CLIENT_S
  add primary key (CLIENT_ID);

prompt Creating CLIENTOCLIENTBANK...
create table CLIENTOCLIENTBANK
(
  client_id NUMBER(5) not null,
  clientid  NUMBER(5) not null
)
;
alter table CLIENTOCLIENTBANK
  add primary key (CLIENT_ID);
alter table CLIENTOCLIENTBANK
  add foreign key (CLIENTID)
  references CLIENT (CLIENTID);
alter table CLIENTOCLIENTBANK
  add foreign key (CLIENT_ID)
  references CLIENT_S (CLIENT_ID);

prompt Creating LOAN...
create table LOAN
(
  loanid      NUMBER(5) not null,
  numofpaymet NUMBER(5) not null,
  loansum     INTEGER not null
)
;
alter table LOAN
  add primary key (LOANID);

prompt Creating LOANTOACCOUNT...
create table LOANTOACCOUNT
(
  loandate      DATE not null,
  returnedornot NUMBER(5) not null,
  loanid        NUMBER(5) not null,
  accountid     NUMBER(5) not null
)
;
alter table LOANTOACCOUNT
  add primary key (LOANID, ACCOUNTID);
alter table LOANTOACCOUNT
  add foreign key (LOANID)
  references LOAN (LOANID);
alter table LOANTOACCOUNT
  add foreign key (ACCOUNTID)
  references ACOUNT (ACCOUNTID);

prompt Creating ORDERS...
create table ORDERS
(
  order_id       NUMBER(3) not null,
  order_date     DATE not null,
  dellivery_date DATE not null
)
;
alter table ORDERS
  add primary key (ORDER_ID);

prompt Creating PRODUCTS...
create table PRODUCTS
(
  product_id    NUMBER(3) not null,
  product_name  VARCHAR2(15) not null,
  quantity      NUMBER(3) not null,
  product_price NUMBER(3) not null,
  category_id   NUMBER(3) not null
)
;
alter table PRODUCTS
  add primary key (PRODUCT_ID);
alter table PRODUCTS
  add foreign key (CATEGORY_ID)
  references CATEGORYS (CATEGORY_ID);
alter table PRODUCTS
  add constraint CHK_QUANTITY2
  check (Quantity >= 0);

prompt Creating ORDER_PRODUCT...
create table ORDER_PRODUCT
(
  product_id NUMBER(3) not null,
  order_id   NUMBER(3) not null
)
;
alter table ORDER_PRODUCT
  add primary key (PRODUCT_ID, ORDER_ID);
alter table ORDER_PRODUCT
  add foreign key (PRODUCT_ID)
  references PRODUCTS (PRODUCT_ID);
alter table ORDER_PRODUCT
  add foreign key (ORDER_ID)
  references ORDERS (ORDER_ID);

prompt Creating ORDER_SUPPLIER...
create table ORDER_SUPPLIER
(
  supplier_id NUMBER(3) not null,
  order_id    NUMBER(3) not null
)
;
alter table ORDER_SUPPLIER
  add primary key (SUPPLIER_ID, ORDER_ID);
alter table ORDER_SUPPLIER
  add foreign key (ORDER_ID)
  references ORDERS (ORDER_ID);

prompt Creating ORDER_WORKER...
create table ORDER_WORKER
(
  worker_id NUMBER(3) not null,
  order_id  NUMBER(3) not null
)
;
alter table ORDER_WORKER
  add primary key (WORKER_ID, ORDER_ID);
alter table ORDER_WORKER
  add foreign key (ORDER_ID)
  references ORDERS (ORDER_ID);

prompt Creating PURCHASE...
create table PURCHASE
(
  purchase_id    NUMBER(3) not null,
  purchase_date  DATE not null,
  dellivery_date DATE not null
)
;
alter table PURCHASE
  add primary key (PURCHASE_ID);

prompt Creating PURCHASE_CLIENT...
create table PURCHASE_CLIENT
